import React from 'react'

class Sidebuttons extends React.Component{
    render(){
        function handleClick(e){
            if(e.props.button_text1 === "Projects"){
                window.location.href = "http://benlottes.com/projects";
            }else if(e.props.button_text1 === "Experience"){
                window.location.href = "http://benlottes.com/experience";
            }else if(e.props.button_text1 === "Resume"){
                window.location.href = "http://benlottes.com/resume";
            }
        }
        return (
            <><div name="button1">
                <button variant="text" onClick={handleClick}>{this.props.button_text1}</button>
            </div><div name="button2">
                <button variant="text" onClick={handleClick}>{this.props.button_text2}</button>
            </div><div name="button3">
                <button variant="text" onClick={handleClick}>{this.props.button_text3}</button>
            </div></>
        )
    }
}

export default Sidebuttons
